const Video = () => {
  return (
    <>
      <div className="contenedor_video">
        <iframe
          width="840"
          height="473"
          src="https://www.youtube.com/embed/tHW2aOuaXBA?controls=0"
          frameborder="0"
          allow="autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>
      </div>
    </>
  );
};

export default Video;
